import React, { useCallback, useEffect, useState } from 'react'
import { Icon } from '@shopify/polaris';
import axios from 'axios'
import { Page, Card, DataTable } from '@shopify/polaris';
import { ProductsMinor } from '@shopify/polaris-icons';
import { InventoryMajor } from '@shopify/polaris-icons';
import { Select } from '@shopify/polaris';
import {Button} from '@shopify/polaris';


export default function Dashboard() {
    const[user , setUser] =useState()
    const[count , setCount]=useState(1)
    var temp = [];
    const [selected, setSelected] = useState(10);
    const options1 = [
        { label: '10', value: '10' },
        { label: '20', value: '20' },
        { label:'30', value: '30' },
        { label:'40', value: '40' },
    ];

    const changepage=(e)=>{
        if(e.target.innerText ==="Prev"){
            if(count>2){
                setCount(count - 1)
            }
          }
          if(e.target.innerText==="Next"){
            if(count<Math.ceil(user/selected)){
                setCount(count + 1)
            }
          }
    }



    const options = [
        { label: 'Equals', value: 'today' },
        { label: 'Yesterday', value: 'yesterday' },
        { label: 'Last 7 days', value: 'lastWeek' },
    ];

    const handleSelectChange = useCallback((value) => setSelected(value),  []);

    useEffect(() => {
        const handler1 = async () => {
            rows.splice(1 , rows.length)   
           const response1 = await axios(` https://fbapi.sellernext.com/frontend/admin/getAllUsers?activePage=${count}&count=${selected}`, {
               headers: {
                   authorization: sessionStorage.getItem('token')
               }
           })
           console.log(response1)
           setUser(response1.data.data.count)

           response1.data.data.rows.map((d) => {
               rows.push([d.user_id, d.catalog, d.username, d.email, d.shopify_plan, d.updated_at, d.created_at, d.shop_url])
           })
       }
        handler1();
    },[rows , selected , count])

 var rows = [
        [
            <Select

                options={options}
            />,
            <Select

                options={options}
            />,
            <Select

                options={options}
            />,
            <Select

                options={options}
            />,
            <Select

                options={options}
            />,
            <Select

                options={options}
            />,
            <Select

                options={options}
            />,
            <Select

                options={options}
            />



        ]

    ];
    return (
        <div id="dashboard_products_main_div_id">
            <div id="inner_dashboard_div_1">
                <p className="p1"><Icon
                    source={InventoryMajor}
                    color="base"
                />Dashboard</p>
                <p className="p1"><Icon
                    source={ProductsMinor}
                    color="base"
                />Products</p><p className="p1"><Icon
                    source={ProductsMinor}
                    color="base"
                />Grid</p>
            </div>
            <div id="inner_dashboard_div_2">
                <h1 id="h1">
                    Data Grid
                </h1>
                <h2 id="h2">
                    Showing from 0 to 10 of 0 users
                </h2>
                <div>
                    <div id="buttons_and_select_div_id">
                        <div>
                            <Button id="btn1" onClick={changepage}>Prev</Button>Results<Button id="btn2" onClick={changepage}>Next</Button></div>
                        <div><Select
                        placeholder="Rows per page"
                        options={options1}
                        onChange={handleSelectChange}
                        value={selected}
                    />
                          </div>
                          <div>
                            <Button>View Coulumns</Button>
                          </div>
                                        </div>

                    <Page title="User Details">
                        <Card>
                            <DataTable
                                columnContentTypes={[
                                    'text',
                                    'numeric',
                                    'text',
                                    'text',
                                    'text',
                                    'text',
                                    'text',
                                    'text',
                                ]}
                                headings={[
                                    'UserId',
                                    'Catalog',
                                    'Shop Domain',
                                    'Shop Email',
                                    'Shop Plan name',
                                    'Updated at',
                                    'Created at',
                                    'Shop myShopify Domain '

                                ]}
                                rows={rows}
                            // totals={['', '', '', 255, '$155,830.00']}
                            />
                        </Card>
                    </Page>
                </div>
            </div>
        </div>
    )
}
